import React from 'react';

const Home = () => {
    return (
        <div>
            <h1>
                Home Page
            </h1>
            <br />
            <Link to={'/blogs'}>
                Blogs
            </Link>
            <br />
            <Link to={'/contacts'}>
                Contacts
            </Link>
        </div>
    );
}

export default Home;
